　２サイクル船外機専用の添加剤・TugUp212Mは、銀粒子がシリンダー内を
常に最適な燃焼状態に保ち、ストールやデトネーション（不正爆発）を
抑える効果があります。プラグ穴から直接シリンダーに入れると効果大です。
・オイル１リットルに対し１本（１０ｃｃ）が使用の目安。
TugUp212_Mは本来の性能をいち早く引き出すには、プラグ穴から
シリンダー内に直接注入することで高い効果が生まれます。
特に振動が多いエンジンやアイドリングで突然ストールする
エンジンには効果的です。<br>
★TugUp２１２_Ｍダイレクトチャージのコツ<br>
＊作業は必ずエンジンを停止させ、冷めた状態で行って下さい。<br>
＊エンジン内に直接注入する時は、エンジンをチルトアップさせ、プラグ穴から目薬を押す要領で作業して頂くと確実です。
無理に入れ込もうとすると必要以上に注入したり、ボトル
キャップが取れたりしますので御注意下さい。）<br>
１気筒あたり（排気量に関係なく）2～３滴が適正量です。（入れすぎは効果半減です）<style>
